import React, {useState, useEffect} from 'react'
import axios from 'axios';

function HomeCasa() {

    const[rooms, setRoooms] = useState([]);
    const[loading, setLoading] = useState();
    const[error, setError] = useState();

    useEffect(() => {
        const fetchData = async () => {
          try {
            setLoading(true);

            const response = await axios.get('/api/v1/houses');
            const houses = response.data;
            setRoooms(houses);
            console.log(houses);

            setLoading(false);
          } catch (error) {
            setError(true);
            console.log(error);
            setLoading(false);
          }
        };
    
        fetchData();
      }, []);

    return (
        <div>
            <h1>Welcome home</h1>
            <h2>There are {rooms.length} houses</h2>
            {loading ? (<h1>Loading...</h1>) : error ? (<h1>Error</h1>) : (rooms.map(room => {}))}
        </div>
    )
}

export default HomeCasa
